function getAge(e){var t=new Date,n=new Date(e),r=t.getFullYear()-n.getFullYear(),a=t.getMonth()-n.getMonth();return(a<0||0===a&&t.getDate()<n.getDate())&&r--,r}function getBmi(e,t){return(e/(t/100*(t/100))).toFixed(2)}function hexToRgb(e,t){var n=parseInt(e,16);return"rgba("+(n>>16&255)+","+(n>>8&255)+","+(255&n)+", "+t+")"}function ratioToPercent(e){return 100*e<100?(100*e).toFixed(2):e}
